import Button from 'react-bootstrap/Button';
import GetUserId from '../utils/GetUserId';

const SurveyPart3 = () => {
    const userId = GetUserId();

    

    function contactMe() {
        const data = {
            userId: userId,
            email: document.getElementById('email').innerHTML
        }  
        fetch("https://stormy-plains-42247.herokuapp.com/sendContactInfo", {
            mode: "cors",
            method: "POST",
            headers: {
                'Content-type': "application/json"
            },
            body: JSON.stringify(data)
        }).then(function(response) {
            return response.json();
        }); 
    }

    return (
        <div id="SurveyPart3">
            <h2>Stort tack för din medverkan i vår enkät.</h2>
            <h2>Dina svar är mycket uppskattade!</h2> 
            <br>
            </br>
            <p>Vi vill återigen intyga att vi inte sparar någon information annat än dina enkätsvar, 
                <br>
                </br>
                samt ett identifierings-ID kopplat till din inloggning för att undvika flera svar från samma person.</p>
            <br>
            </br>
            <p>Eventuellt kan uppföljningsintervjuer göras för att djupare undersöka hur människor resonerar kring
                <br>
                </br>
                objektklassificering samt hur de tänker kring AI-modeller för samma syfte. 
                <br>
                </br>
                Om du kan tänka dig att medverka i en sådan intervju så fyll i din e-postaddress nedan och tryck på knappen “Kontakta mig”. Du har då även möjlighet att ställa frågor om undersökningen. Notera att vi då självklart sparar din e-postadress, men ej kopplar denna till dina enkätsvar på något vis. Tack!</p>
            <br></br>
            <form>
                <label>Epost:</label>
                <br>
                </br>
                <input type="text" id="email" name="email"></input>
                <br>
                </br>
                <Button style={{ marginTop: "20px"}} id="Submit-email" variant="outline-secondary" onClick={contactMe}>Kontakta mig</Button>
            </form>
          
        </div>
    )
}

export default SurveyPart3;
